import React from 'react'
import styled from "styled-components"
function SingUp() {
    return (
        <Wrapper>
        <PageTitle>
        <span>bitermoscoffe</span>
        </PageTitle>

        <SingUpContainer>
        SingUp
        </SingUpContainer>


        </Wrapper>
    )
}
const Wrapper = styled.div`
position: relative;
    display: flex;
    justify-content:center;
align-items:center;

    flex-direction: column;

    max-width: 472px;
    width: 100%;

    color: #484848;







`;

const PageTitle = styled.div``;

const SingUpContainer = styled.div`
position: relative;
    display: flex;
    justify-content:center;
align-items:center;

    flex-direction: column;
    padding: 72px;
    border: 1px solid #e5e5e5;
    border-radius: 8px;
    max-width: 472px;
    width: 100%;
    margin: 0 auto;
    color: #484848;`;

export default SingUp
